import React from "react";
import heroImage from "../assets/llamacorn_residents.JPG";

function Hero(props){
    return (
    <div className="hero" style={{ backgroundImage: `url(${props.backgroundImage})`}}>
        <img src={heroImage} alt={"animalcrossing-residents"}/>
        {props.children}
        </div>
        )
}

export default Hero;
